  false,\n\t\"url\": null,\n\t\"notes\": \"The primary goal of the annual water plan
  is to set a strategy for the most  efficient use of the available water delivered
  to Stillwater WMA. For all practical purposes, Fallon NWR no longer receives sufficient
  water down the Carson River to maintain any quality wetlands. Now that the flood
  waters are receding we will have to deal with full impacts of the new Operating
  Criteria and Procedures (OCAP). It looks like we will receive 40,000 AF. This is
  the 1987 plan.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
